import React, {Component} from 'react';
import {Map, InfoWindow, Marker, GoogleApiWrapper} from 'google-maps-react';
 
export class MapContainer extends Component {
  render() {
      
    return (
        <Map google={this.props.google} 
        initialCenter={{
            lat: 18.796143,
            lng: 98.979263
          }}
        
        zoom={14}>
 
        <Marker onClick={this.onMarkerClick}
                name={'Current location'} />
        <Marker name={'Doi Suthep '}  position={{lat: 18.733393, lng: 98.950960}} />
        <Marker name={'หางดง'}  position={{lat: 18.686275, lng: 98.919334}} />
        <Marker name={'ดอยคำ'}  position={{lat: 19.137615, lng: 98.908647}} />
 
        <InfoWindow onClose={this.onInfoWindowClose}>
            
        </InfoWindow>
      </Map>

    
    );
  }
}
 
export default GoogleApiWrapper({
  apiKey: ("AIzaSyCS4QDM_de0JGU7Qux2xa4VhxtVdmgXRJA")
})(MapContainer)
